// 画像の読み込み
void LoadCgMapChip_1() {
	LoadBlkTexture("res/tileset.png", CHIPSIZE_W, CHIPSIZE_H, CHIPCOUNT_W, CHIPCOUNT_H, CHIPCOUNT, cgChip);
}

